var DrawingBoard = (function() {
    var controls = null;
    var controlId = null;
    var historyTracker=[];
    var historyIndex=null;
    var activePropertyWindow = null;

    var init = function() {
        this.controlId = 0;
        this.historyIndex=-1;
        this.controls = [];
        this.create();
        var _this = this;

        Toolbox.init();
        PropertyWindow.init();

        this.setupPropertyWindow();
        PreviewBinding.init();
        NavigationBar.init();
        $("#undo-sketch-link").click(function(ev){
            _this.historyIndex = _this.historyIndex-1;
            _this.clear();
            for(var i=2; i<=_this.controlId; i++){
                delete _this.controls[i];
                $("#drawing-board").html("");
            }
            $("#drawing-board").html(historyTracker[_this.historyIndex]);
        });

        $("#redo-sketch-link").click(function(ev){
            _this.historyIndex = _this.historyIndex+1;
            _this.clear();
            for(var i=2; i<=_this.controlId; i++){
                delete _this.controls[i];
                $("#drawing-board").html("");
            }
            $("#drawing-board").html(historyTracker[_this.historyIndex]);
        });
        Toolbox.showControlWindow();
        CopyPasteBinding.init();
    };

    var create = function() {
        this.controlId = this.controlId + 1;
        var initialData = jQuery.extend(true, {}, ControlsMetadata["DrawingBoardControl"].initialData);
        initialData["controlId"] = this.controlId;

        this.controls[this.controlId] = new Ractive({
            el: "body",
            template: "#DrawingBoardControl-control-template",
            data: initialData,
            append: true
        });
        PageSwitchBinding.init();
    };

    var setupPropertyWindow = function() {
        this.activePropertyWindow = PropertyWindow.create("DrawingBoardControl", this.controls[1].get(), this.controls[1]);
        this.bindPropertyWindow();

        var _this = this;
        $("#drawing-board").click(function(ev){
            $(".control.active").draggable("destroy");
            $("#drawing-board .control").removeClass("active");


            if(!$("body").hasClass("toolbox-left-open")){
                return;
            }

            _this.activePropertyWindow = PropertyWindow.create("DrawingBoardControl", _this.controls[1].get(), _this.controls[1]);
            _this.bindPropertyWindow();
        });

        $("#drawing-board").dblclick(function(ev){
            _this.activePropertyWindow = PropertyWindow.create("DrawingBoardControl", _this.controls[1].get(), _this.controls[1]);
            _this.bindPropertyWindow();
        });

    };

    var addControl = function(metadataId, position, data, previewMode, unselect) {
        this.controlId = this.controlId + 1;
        if(!data){
            data = jQuery.extend(true, {}, ControlsMetadata[metadataId].initialData);
        }
        data["controlId"] = this.controlId;
        this.controls[this.controlId] = Control.create(metadataId, position, data, previewMode, unselect);
        var tempHistory = $("#drawing-board").html();
        this.historyIndex = this.historyIndex+1;
        historyTracker[this.historyIndex]= tempHistory;

        var layers = this.controls[1].get("layers");
        for(var i=layers.length; i>0;i--){
            layers[i] = layers[i-1];
        }
        layers[0]= {metadataId: metadataId, controlId: this.controlId};
        this.controls[1].set("layers",layers);

        if(!previewMode){
            this.bindDeleteControl(this.controlId);
            this.activePropertyWindow = PropertyWindow.create(metadataId, this.controls[this.controlId].get(), this.controls[this.controlId]);
            this.bindControl(this.controlId);
            this.bindPropertyWindow();
        }
    };

    var bindControl = function(controlId){
        var _this = this;

        $(".control[data-control-id=" + controlId + "]").click(function(ev){
            ev.stopPropagation();
            var element = $(ev.currentTarget);

            if(!ev.ctrlKey && !ev.metaKey){
                $("#drawing-board .control").removeClass("active");
            }

            element.addClass("active");

            if($(".control.active").hasClass("ui-draggable")){
                $(".control.active").draggable("destroy");
            }

            $(".control.active").multiDraggable({ containment: "parent", cancel: null ,group: $(".control.active")});

            if(!$("body").hasClass("toolbox-left-open")){
                return;
            }

            _this.openPropertyWindow(element, controlId);
        });

        $(".control[data-control-id=" + controlId + "]").dblclick(function(ev){
            ev.stopPropagation();
            var element = $(ev.currentTarget);
            _this.openPropertyWindow(element, controlId);
        });
    };

    var bindPropertyWindow = function(){
        var _this = this;
        $("#properties-container .properties").on("change", ".property", (function(ev){
            var controlId = $(ev.currentTarget).closest(".properties").data("control-id");
            _this.controls[controlId].set(_this.activePropertyWindow.get());
        }));
    };

    var openPropertyWindow = function(element, controlId){

        if(this.activePropertyWindow.get("controlId") == controlId){
            return;
        }
        this.activePropertyWindow = PropertyWindow.create(element.data("metadata-id"), this.controls[controlId].get(), this.controls[controlId]);
        this.bindPropertyWindow();
    };

    var bindDeleteControl = function(controlId){
        var _this=this;
        $("#drawing-board .control[data-control-id='" + controlId + "'] .delete").click(function(ev){
            ev.stopPropagation();
            $("#drawing-board .control[data-control-id='" + controlId + "']").remove();
            delete _this.controls[controlId];
            var tempHistory = $("#drawing-board").html();
            _this.historyIndex = _this.historyIndex+1;
            historyTracker[_this.historyIndex]= tempHistory;
        });
    };

    var clear = function(){
        $("#drawing-board").html("");
        for(var i=2; i<=this.controlId; i++){
            delete this.controls[i];
        }
    };

    return {
        init: init,
        create: create,
        setupPropertyWindow: setupPropertyWindow,
        addControl: addControl,
        bindControl: bindControl,
        bindPropertyWindow: bindPropertyWindow,
        openPropertyWindow: openPropertyWindow,
        bindDeleteControl: bindDeleteControl,
        clear: clear
    };

})();
var Sketch = (function() {

    var save = function(attrs, callback) {
        $.ajax({
            type: "POST",
            url: "/projects/" + attrs.projectId + "/sketches/" + attrs.sketchId,
            dataType: "json",
            data: {
                data: attrs.data
            },
            success: callback
        });
    };

    var find = function(attrs, callback){
        $.ajax({
            type: "GET",
            url: "/projects/" + attrs.projectId + "/sketches/" + attrs.sketchId,
            dataType: "json",
            success: callback
        });
    };

    var add = function(attrs, callback){
        $.ajax({
            type: "POST",
            url: "/projects/" + attrs.projectId + "/sketches/add",
            dataType: "json",
            data: {
                sketch_name: attrs.sketchName
            },
            success: callback
        });
    };

    return {
        save: save,
        find: find,
        add: add
    };

})();
var NavigationBar = (function() {

    var init = function() {
        $("#save-sketch-link").click(function(ev){
            SketchesController.save(function(){});
        });

        $("#preview-link").click(function(ev){
            PreviewBinding.trigger();
        });

        $( "#sketches-dropdown" ).on( "click", "#new-sketch-link", function() {
            $('#new-sketch-modal').modal("show");
        });

        $("#create-sketch-link").click(function(ev){
            SketchesController.add();
            $('#new-sketch-modal').modal("hide");
        });

        $("#clear-sketch-link").click(function(ev){
            $("#clear-sketch-modal").modal("show");
        });

        $("#clear-sketch-modal-submit").click(function(ev){
            DrawingBoard.clear();
            $("#clear-sketch-modal").modal("hide");
        });

        $(".share-link").click(function(ev){
            ev.preventDefault();
            $('#share-url-modal').modal("show");
            var port = "";
            if(window.location.port != ""){
                port = ":" + window.location.port;
            }

            $("#share-url").val("http://" + window.location.hostname + port + $(ev.currentTarget).data("href"));
        });
    };

    return {
        init: init
    };

})();
var PropertyWindow = (function() {
    var init = function(){
    };

    var create = function(metadataId, data, controlRactive) {
        var propertyWindowData = new Ractive({
            el: "properties-container",
            template: "#" + metadataId + "-property-template",
            data: data
        });
        ColorPickerBinding.init(controlRactive, propertyWindowData);
        DropdownBinding.init(controlRactive, propertyWindowData);
        StandardPickerBinding.init(controlRactive, propertyWindowData);
        FontPickerBinding.init(controlRactive, propertyWindowData);
        SliderBinding.init(controlRactive, propertyWindowData);

        ControlsMetadata[metadataId].propertyWindowCallback(controlRactive);
//        Toolbox.openToolbox();
        Toolbox.showPropertyWindow();
        return propertyWindowData;
    };

    return {
        init: init,
        create: create
    };

})();
var Toolbox = (function() {

    var init = function() {
        $('#toolbox-link').sidr({
            name: 'toolbox-left',
            side: 'left'
        });
        new Ractive({
            el: "toolbox-left",
            template: "#toolbox-template"
        });
        this.bindToolBox();
        this.bindControls();

        $("#controls-container ul li a").draggable({ helper:'clone'});

        $.sidr('open', 'toolbox-left');
    };

    var bindControls = function() {
       var _this = this;
        $("#drawing-board").droppable({
            accept: '#controls-container ul li a',
            drop: function(event, ui) {
                var drawingBoardPositions = $("#drawing-board")[0].getBoundingClientRect();
                var position = {
                    top: ui.position.top - drawingBoardPositions.top,
                    left: ui.position.left - drawingBoardPositions.left
                }

                var metadataId = $(ui.draggable).data("metadata-id");

                if(ControlsMetadata[metadataId].groupControl){
                    var controls = ControlsMetadata[metadataId].controls;
                    for(var i=0; i<controls.length; i++){
                        var updated_position = {
                            top: position.top + controls[i].position.top,
                            left: position.left + controls[i].position.left
                        }

                        var data = jQuery.extend(true, {}, controls[i].data);

                        DrawingBoard.addControl(controls[i].metadataId, updated_position, data, false, false);
                    }
                    if($(".control.active").hasClass("ui-draggable")){
                        $(".control.active").draggable("destroy");
                    }
                    $(".control.active").multiDraggable({ containment: "parent", cancel: null ,group: $(".control.active")});
                }
                else{
                    DrawingBoard.addControl(metadataId, position, null, false, true);
                }


                _this.showPropertyWindow();
            }
        });
    };

    var bindToolBox = function() {
        $("#toolbox-left ul.toolbox-tab li a").click(function(ev){
            $("#toolbox-left .toolbox-tab-container").hide();
            $("#toolbox-left ul.toolbox-tab li").removeClass("active");
            $("#" + $(ev.currentTarget).data("id")).show();
            $(ev.currentTarget).parent("li").addClass("active");
        });
        this.showControlWindow();
    };

    var showControlWindow = function(){
        $("#toolbox-left ul.toolbox-tab li a[data-id='controls-container']").trigger("click");
    };

    var showPropertyWindow = function(){
        $("#toolbox-left ul.toolbox-tab li a[data-id='properties-container']").trigger("click");
    };

    var openToolbox = function(){
        $.sidr('open', 'toolbox-left');
    }

    return {
        init: init,
        bindControls: bindControls,
        bindToolBox: bindToolBox,
        showControlWindow: showControlWindow,
        showPropertyWindow: showPropertyWindow,
        openToolbox: openToolbox
    };

})();

















